import React from "react";
import SongList2 from "./SongList2"
import Song from "../data/songs.json";

class SongList extends React.Component {
  render() {
    return (
      <div>
        <table>
          <thead>
            <th>Artist</th>
            <th>Title</th>
          </thead>
          {
          Song.filter(song => song.artist.includes("")).filter(song => song.title.includes("")).map((Song) => {
            return (
              <SongList2 song = {Song}/>
            );
          })
          }
        </table>
      </div>
    );
  }
}

export default SongList;
